import React from "react";
import Cards from './CardsComp';
import Slides from './Slide';
import './../CSS/home.css';

class Home extends React.Component {

    render() {
        return (
           <div>
                <Slides /><br /><br />
                <p className='smallhead'>Simply Amazing Places</p>
                <p className='head1'>Popular Destinations</p><br /><br />
                <Cards />
           </div>
            );
    }
}

export default Home;
